  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Upper
  Souris NWR outlines Refuge accomplishments during the 1983 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses management planning and compliance with
  environmental and cultural resource mandates. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
  pest control, and water rights. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, wildlife propagation, marking and bird banding,
  and disease control. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
  observation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  equipment replacement, and communication systems. Items of interest are provided
  at the end. Refuge brochures, newspaper articles, and field guides are attached.\",\n\t\"owner_org\":
